import Head_Banner from "../components/Head_Banner";
import Layout from "../layouts/Layout";

const Safe_Investment = () => (
  <Layout>
    <Head_Banner
      text_1={"Safe Investment"}
      text_2={"Safest investment here."}
    />
  </Layout>
);

export default Safe_Investment;
